import React from 'react';
import { Container, Row, Col } from 'reactstrap';

const Home = () => (
    <div>
        <Container>
            <Row>
                <Col sm="12" md={{ size: 12, align: 'center' }}><h1>Next.js + Bootstrap</h1></Col>
            </Row>
        </Container>
    </div>
)

export default Home
